#Command for show ErrorNoSelect
command_ErrorNoSelect=f"""
#!/usr/bin/env bash
echo Please select at least one option.
"""                
#/////////////////////////////////////////////////////////////////////////////
#/////////////////////////////////////////////////////////////////////////////

class PharmVIP(tk.Tk):
    def __init__(self, *args, **kwargs):
        tk.Tk.__init__(self, *args, **kwargs)
        container = tk.Frame(self)
        container.grid_propagate(0)
        container.pack(side="top", fill=tk.BOTH, expand=True)
        container.grid_rowconfigure(0, weight=1)
        container.grid_columnconfigure(0, weight=1)
        self.frames = {}
        for F in (VCFPage, BAMPage):
            page_name = F.__name__
            frame = F(parent=container, controller=self)
            self.frames[page_name] = frame
            if (page_name == "VCFPage"):
                frame.configure(bg="#F1948A")
            elif (page_name == "BAMPage"):
                frame.configure(bg="#ABEBC6")
            frame.grid(row=0, column=0, sticky="nsew")
        self.show_frame("VCFPage")

        menubar = tk.Menu(self)
        self.aboutVersionCheck = False
        about = tk.Menu(menubar, tearoff=0)
        about.add_command(label="Version", command=self.openVersionWindow)
        about.add_command(label="About PharmVIP", command=self.openPharmVIPAboutWebsite)
        about.add_command(label="Go To PharmVIP Website", command=self.openPharmVIPHomepageWebsite)
        menubar.add_cascade(label="About", menu=about)
        
        self.helpReportCheck = False
        help = tk.Menu(menubar, tearoff=0)
        help.add_command(label="Go To PharmVIP Manual", command=self.openPharmVIPManualWebsite)   
        help.add_separator()      
        help.add_command(label="Contact Us", command=self.openPharmVIPContactUsWebsite)
        help.add_command(label="Feedback", command=self.openPharmVIPReportWindow)  
        menubar.add_cascade(label="Help", menu=help)  
    
        self.config(menu=menubar) 

    #===================================================================
    # Menu bar

    def openPharmVIPHomepageWebsite(self):
        webbrowser.open("https://pharmvip.nbt.or.th/pharmvip/index" ,new=1)

    def openPharmVIPAboutWebsite(self):
        webbrowser.open("https://pharmvip.nbt.or.th/pharmvip/about" ,new=1)

    def openPharmVIPContactUsWebsite(self):
        webbrowser.open("https://pharmvip.nbt.or.th/pharmvip/contact" ,new=1)
    
    def openPharmVIPManualWebsite(self):
        webbrowser.open("https://pharmvip.nbt.or.th/pharmvip/manual" ,new=1)

    # About Version Window =====
